description:
Den unge collegestudenten Sam deltar lite motvilligt i sina kompisars tavling for att se vilka som nar terminen ar slut har raggat upp de snyggaste studentskorna.

Nar mannen i den lilla staden en efter en borjar forsvinna gar det upp for Sam och hans kompisar att nar det handlar om vackra kvinnor sa ar det deras inre skonhet som egentligen betyder nagot.........


